.hdrTxt h3, .hdrTxt p, .hdrTxt span{color:#333333; text-align:right; font-weight:normal;}
.hdrTxt h3{font-size:20px; font-weight:bold;}
.hdrTxt span{font-size:18px; font-weight:normal;}	


